import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import { Route, Switch, Link } from 'react-router-dom';

import ItemIndex from "./components/itemIndex";
import itemDetails from "./components/itemDetails";
// import Signup from "./components/Signup";
// import UserService from "./services/UserService";
import Login from "./components/Login";

class App extends Component {
  render() {
    return <div className="App">
          <nav>
            <ul>
              <li>
            <Link to="/itemList"> View Projects</Link>
            </li>
            <li>
            <Link to="/signup"> Sign Up For Account</Link>
            </li>
            <li> 
            <Link to="/login"> Login </Link>
              </li>
            </ul>
          </nav>

        <Switch>
          <Route path="/itemList" render={props => <ItemIndex />} />
          <Route path="/itemList/:id" component={itemDetails} />

          {/* <Route path="/signup" render={props => <Signup {...props} logTheUserIntoAppComponent={this.logInTheUser} />} /> */}
  <Route path="/login" render={props => <Login /> }/>
        </Switch>
      </div>;
  }
}

export default App;
